import { UsersReduser } from "./reducers/usersReduser"

let store = {
    _state: {
        userPage: [
            {
                id: 1,
                name: 'John'
            },
            {
                id: 2,
                name: 'James'
            }
        ],

        postsPage: [
            {
                id: 1,
                text: "smt"
            },
            {
                id: 2,
                text: "about"
            },
        ]
    },

    getState() {
        return this._state
    },
    dispatch(action) {
        this._state = UsersReduser(this._state, action)
    }
}
